import React, { useState } from "react";
// let curtime = new Date().toLocaleTimeString();

const App = () => {
  let time=new Date().toLocaleTimeString();
  
  const[curtime,uptime]=useState(time);

  const clicked=()=>{
    
    uptime(curtime+1);
  }
  return(
    <> 
  <h1>{time}</h1>
  <button onClick={clicked}>Get Time</button>
  </>
  );
};
export default App;
